/// id : 3342
/// description : "If the base sequence in DNA is 5' AAAT 3' then the base sequence in mRNA is :"
/// difficulty_level : null
/// topic : "Molecular Basis Of Inheritance "
/// is_published : true
/// created_at : "2024-07-13T23:16:31.854+05:30"
/// updated_at : "2025-01-16T23:31:52.806+05:30"
/// detailed_solution : "To determine the mRNA sequence from the given DNA sequence, we follow the principles of transcription, where RNA is synthesized complementary to the DNA template strand. Here's the step-by-step process:\r\n\r\nGiven DNA Sequence:\r\n5\r\n‚Ä≤\r\n‚Äâ\r\nùê¥\r\nùê¥\r\nùê¥\r\nùëá\r\n‚Äâ\r\n3\r\n‚Ä≤\r\n5 \r\n‚Ä≤\r\n AAAT3 \r\n‚Ä≤\r\n \r\nTranscription Rules:\r\nComplementary Base Pairing:\r\n\r\nAdenine (A) in DNA pairs with Uracil (U) in RNA.\r\nThymine (T) in DNA pairs with Adenine (A) in RNA.\r\nCytosine (C) pairs with Guanine (G), and vice versa.\r\nRNA is synthesized in the 5' to 3' direction, complementary to the 3' to 5' DNA template strand.\r\n\r\nDNA Template Strand:\r\nTo determine the template strand, we first identify the complementary strand of the given DNA sequence. The template strand is:\r\n\r\n3\r\n‚Ä≤\r\n‚Äâ\r\nùëá\r\nùëá\r\nùëá\r\nùê¥\r\n‚Äâ\r\n5\r\n‚Ä≤\r\n3 \r\n‚Ä≤\r\n TTTA5 \r\n‚Ä≤\r\n \r\nmRNA Sequence:\r\nThe mRNA is transcribed from the template strand using complementary base pairing:\r\n\r\n5\r\n‚Ä≤\r\n‚Äâ\r\nùê¥\r\nùê¥\r\nùê¥\r\nùëà\r\n‚Äâ\r\n3\r\n‚Ä≤\r\n5 \r\n‚Ä≤\r\n AAAU3 \r\n‚Ä≤\r\n \r\nFinal Answer:\r\nThe base sequence in mRNA is: 5' AAAU 3'."
