ortant\">Thymine (T)</span> being replaced by <span class=\"important\">Uracil (U)</span>.  <span class=\"important\">RNA synthesis</span> proceeds in the <span class=\"important\">5' to 3' direction</span>, similar to <span class=\"important\">DNA replication</span>.</p></section>","</body></html>"],"practice_material":{"content":["<!DOCTYPE html>\n<html>\n<head>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<title>DNA and RNA Transcription</title>\n</head>\n<body>\n<h1>DNA and RNA Transcription</h1>\n<section><h2>Introduction to DNA and RNA</h2>\n<p>DNA and RNA are molecules that carry genetic information. <span class=\"important\">DNA</span> is the primary storage location for this information, while <span class=\"important\">RNA</span> plays a crucial role in using that information to synthesize <span class=\"important\" keyword=\"proteins\">________</span>.</p></section>\n</body>\n</html>\n","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><section><h2>Transcription: Copying DNA to RNA</h2>\n<p><span class=\"important\">Transcription</span> is the process of copying information from <span class=\"important\">DNA</span> into <span class=\"important\">RNA</span>.  This can be thought of as making a photocopy: the <span class=\"important\" keyword=\"DNA\">________</span> is the original document, and the <span class=\"important\" keyword=\"RNA\">________</span> is the copy.</p></section></body></html>\n","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><section><h2>Base Pairing Rules in Transcription</h2>\n<p>The copying process during <span class=\"important\">transcription</span> follows specific <span class=\"important\">base pairing rules</span>:</p>\n<ul>  <li>\n<span class=\"important\">Adenine (A)</span> in DNA pairs with <span class=\"important\">Uracil (U)</span> in RNA</li>  <li>\n<span class=\"important\">Thymine (T)</span> in DNA pairs with <span class=\"important\" keyword=\"Adenine (A)\">________</span> in RNA</li>  <li>\n<span class=\"important\">Guanine (G)</span> pairs with <span class=\"important\">Cytosine (C)</span>\n</li>  <li>\n<span class=\"important\">Cytosine (C)</span> pairs with <span class=\"important\" keyword=\"Guanine (G)\">________</span>\n</li>\n</ul>\n<p>The order of bases in the <span class=\"important\">DNA sequence</span> is preserved in the <span class=\"important\" keyword=\"RNA sequence\">________</span>, with the exception of <span class=\"important\">Thymine (T)</span> being replaced by <span class=\"important\" keyword=\"Uracil (U)\">________</span>.  <span class=\"important\">RNA synthesis</span> proceeds in the <span class=\"important\">5' to 3' direction</span>, similar to <span class=\"important\">DNA replication</span>.</p></section></body></html>\n","<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n\n"],"keywords":["proteins","DNA","RNA","Adenine (A)","Guanine (G)","RNA sequence","Uracil (U)"]}}
